import React, { Component } from 'react';

class AddProductForm extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-8 mx-auto">
                        <form action="/adddata" method="POST">
                            <div className="form-group">
                                <label htmlFor="productName">Name of Product</label>
                                <input type="text" className="form-control" name="productName" id="productName" aria-describedby="helpId" placeholder="Name of Product" />
                            </div>
                            <div className="form-group">
                                <label htmlFor="productPrice">Price of Product</label>
                                <input type="text" className="form-control" name="productPrice" id="productPrice" aria-describedby="helpId" placeholder="Price of Product" />
                            </div>
                            <div className="form-group">
                                <label htmlFor="productImage">Image of Product</label>
                                <input type="text" className="form-control" name="productImage" id="productImage" aria-describedby="helpId" placeholder="Image of Product" />
                            </div>
                            <button type="submit" className="btn btn-info btn-block">Submit</button>
                        </form>
                    </div>
                </div>
            </div>

        );
    }
}

export default AddProductForm;
